import styled from "styled-components";

export const Conteiner = styled.div`
  background-color: red;
  height: 561px;
  display: block;
`;

export const SimpleSliderConteiner = styled.div`
  overflow: hidden;

  margin-left: 33px;
  width: 279px;
  height: 495px;
  border-radius: 8.11px;
  @media (max-width: 768px) {
    max-height: 400px;
    margin: 20vw auto;
    width: 100%;
  }
`;
